span></td></tr><tr><td class=\"line-number\"><br/></td><td class=\"line-content\">	require([&#39;daniu/cp&#39;]);</td></tr><tr><td class=\"line-number\"><br/></td><td class=\"line-content\">	<span class=\"html-tag\">&lt;/script&gt;</span></td></tr><tr><td class=\"line-number\"><br/></td><td class=\"line-content\">	<span class=\"html-tag\">&lt;/body&gt;</span></td></tr><tr><td class=\"line-number\"><br/></td><td class=\"line-content\"><span class=\"html-tag\">&lt;/html&gt;</span><span class=\"html-end-of-file\"></span></td></tr></tbody></table><p><br/></p>'),(19,'0','0','用户协议','用户协议',NULL,'2020-03-16 10:45:14',NULL,NULL,'<p><span style=\"font-size: 18px;\"><strong>用户协议</strong></span></p><p><span style=\"font-size: 18px;\"><span style=\"font-size: 16px;\"></span></span></p><p>乌鲁木齐市境最北点在<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%A4%B4%E5%B1%AF%E6%B2%B3\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">头屯河</a>下游距<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E4%BA%94%E5%AE%B6%E6%B8%A0\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">五家渠</a>市3.5千米处，最南点抵阿拉沟以南夏格泽山脊，南北最宽处约153千米；市境最东点在高崖子牧场东边石窑子艾肯沟内，最西点在胜利达坂以西的天格尔山脊，东西最长约190千米。海拔580米-920米。自然坡度12‰-15‰。<span class=\"sup--normal\" style=\"font-size: 10.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em; margin-left: 2px; color: rgb(51, 102, 204); cursor: pointer; padding: 0px 2px;\">[14]</span><a class=\"sup-anchor\" style=\"color: rgb(19, 110, 194); position: relative; top: -50px; font-size: 0px; line-height: 0;\">&nbsp;</a></p><p>乌鲁木齐地势起伏悬殊，山地面积广大。南部、东北部高，中部、北部低。最高点天山博格达峰顶，海拔5445米；最低处在猛进水库的大渠南侧，海拔490.6米。两地水平距离75千米，高差4954.4米。山地面积占总面积50%以上，北部冲积平原不及总面积的1/10，市区平均海拔800米。<span class=\"sup--normal\" style=\"font-size: 10.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em; margin-left: 2px; color: rgb(51, 102, 204); cursor: pointer; padding: 0px 2px;\">&nbsp;[5]</span><a class=\"sup-anchor\" style=\"color: rgb(19, 110, 194); position: relative; top: -50px; font-size: 0px; line-height: 0;\">&nbsp;</a></p><p>乌鲁木齐市区三面环山，北部平原开阔。东部有博达山、喀拉塔格山、东山；西部有喀拉扎山、西山；南部有伊连哈比尔尕山东段（天格尔山）、土格达坂塔格等。辖区地势由东南向西北降低，大致分为三个梯级：第一级为山地，海拔2500-3000米或更高；第二级为山间盆地与丘陵，海拔1000-2000米；第三级为平原，海拔在600米以下。</p><p><span style=\"font-size: 18px;\"><span style=\"font-size: 16px;\"></span><strong><span style=\"font-size: 16px;\"></span><br/></strong></span><br/></p>');
